pragma solidity ^0.5.0;

import "./Client.sol";

contract Parking{
    address payable owner;
    uint pricePerDay;
    string description;
    Client client;

    constructor(string memory _description, uint _pricePerDay,address payable _sender) payable public{
        owner = _sender;
        pricePerDay = _pricePerDay;
        description = _description;
        client = new Client("","",0,address (0),false);

    }

    function isRented() public returns(bool){
        return client.checkExists();
    }
    function setPricePerDay(uint newValue,address sender) public returns(bool){
        if(owner == sender){
            pricePerDay = newValue;
            return true;
        }
        return false;
    }
    function setClient(Client _client) public{
        client = _client;
    }
    function getClient() public returns(Client){
        return client;
    }
    function getPricePerDay() public returns(uint){
        return pricePerDay;
    }
    function getOwner() public returns(address payable){
        return owner;
    }
}
